import React, { Component } from 'react';

class gallery extends Component {
    render() {
        return (
            <div className="container">
                <div className="gallery-title ">
                    <div className="display-5 h3">GRAPHICS CARD GALLERY</div>
                </div>
            </div>
        );
    }
}

export default gallery;
